data:
  definition: quotient du nombre des tentatives d'appel observées pendant un intervalle
    de temps spécifié par la durée de cet intervalle
  examples: []
  notes:
  - L'intensité d'appel se rapporte à l'un des sens d'établissement des appels, à
    l'autre sens ou à l'ensemble des deux sens.
